import React, { Component } from 'react'

export default class Button extends Component {
  constructor(props){
    super(props)
  }
  state = {
    clicked:false
  };
  
  render() {
    return (
      <div>
          <button className="btn btn-primary btn-sm">{this.text}</button>
      </div>
    )
  }
}
